import React from "react";
import ContactForm from "./ContactForm";

const Contact = () => {
	return (
		<>
			<h1>Contact Us</h1>
			<ContactForm />
			<h3>Want to contact us?</h3>
			<h4>Tel: 0131 226 6066 (0730-1900 daily)</h4>
			<h4>Email: tours@timberbushtours.com</h4>
			<h4>find us on:</h4>
		</>
	);
};

export default Contact;
